import React from 'react';

const SectionB = () => {
    return (
        <div className='sectionb'>
            <div className='row'>
                <div className='col-6'>
                   <img src="https://player.vimeo.com/external/638914554.hd.mp4?s=81b54b0804759c55f2fa55db7c39b7ea8cca0abc&profile_id=175" />
                </div>
                <div className='col-6'>
                   For Friendly Faces
                </div>
            </div> 
        </div>
    )
}

export default SectionB;
